import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: `
    <router-outlet></router-outlet>
  `,
  styles: [
    `
      html, body, :host, :host > * {
        padding: 0;
        margin: 0;
        height: 100%;
        width: 100%;
      }
      :host {
        padding: 0;
        margin: 0;

        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
        box-sizing: border-box;
        overflow: hidden;
      }
    `,
  ],
})
export class AppComponent { }
